export default class GridDemo extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfColumns: 2
        };
        this.ref = React.createRef();
    }
    setNumberOfColumns = () => {
        const gridWidth = this.ref.current.getBoundingClientRect().width;
        const numberOfColumns =
            gridWidth <= 640
                ? 2
                : Math.floor(gridWidth / this.props.elementWidth);
        this.setState({ numberOfColumns });
    };

    componentDidMount() {
        this.setNumberOfColumns();

        window.onresize = event => {
            this.setNumberOfColumns();
        };
    }
    render() {
        return (
            <div ref={this.ref}>
                <Grid
                    columnNumber={
                        this.state.numberOfColumns
                            ? this.state.numberOfColumns
                            : 3
                    }
                >
                    {images.map(val => {
                        return (
                            <img
                                style={{ width: "100%", height: "auto" }}
                                src={val}
                                alt="no"
                            />
                        );
                    })}
                </Grid>
            </div>
        );
    }
}

GridDemo.defaultProps = {
    elementWidth: 300
};
